// src/components/InfoCard.jsx
import React from 'react';
import './InfoCard.css';

const InfoCard = ({ data }) => {
  if (!data) return null;

  return (
    <div className="info-card" style={{ borderColor: data.color || '#ccc' }}>
      <h2 style={{ color: data.color || '#333' }}>{data.name}</h2>
      {data.location && <p><strong>Location:</strong> {data.location}</p>}
      {data.color && <p><strong>Color:</strong> {data.color}</p>}
      {data.frequency && <p><strong>Frequency:</strong> {data.frequency}</p>}
      {data.element && <p><strong>Element:</strong> {data.element}</p>}
      {data.governs && <p><strong>Governs:</strong> {data.governs}</p>}
      {data.emotion && <p><strong>Emotion:</strong> {data.emotion}</p>}
      {data.organs && <p><strong>Organs:</strong> {data.organs}</p>}
      {data.imbalances && <p><strong>Imbalances:</strong> {data.imbalances}</p>}
      {data.tips && <p><strong>Tips:</strong> {data.tips}</p>}
      {data.description && <p>{data.description}</p>}
      {data.content && <p>{data.content}</p>}
    </div>
  );
};

export default InfoCard;
